import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super();

    this.state = {
      ping: 'asd'
    }
  }

  getUsers = async () => {
    var response = await fetch(
      'api/ping',
      {
        method: 'get'
      }
    );

    var responseJson = await response.json();

    this.setState({
      ping: responseJson.val
    })
  }

  render() {
    this.getUsers()
    const pingr = this.state.ping;

    return (
      <div className='App'>
        <button onClick={this.getUsers}>Ping</button>
        <div>
          <label>{pingr}</label>
        </div>
        </div>
    )
  }
}

export default App;
